import axiosInstance from '../utils/axiosConfig'
import { useNavigate } from "react-router-dom";
import { ACCOUNT_API_URL } from '../constant/apiUrls';

const headers = {
  'Content-Type': 'application/json'
}
const accessToken = localStorage.getItem("token");

export const CertificationCreate = (body) => {
  return axiosInstance
    .post(ACCOUNT_API_URL.certificateCreate, body)
}

export const CertificationUpdate = (queryParams,body) => {
  return axiosInstance
    .post(ACCOUNT_API_URL.UpdateCertificate,body,{
      params:queryParams,  
    })

}

export const CertificationView = (queryParams) => {
  return axiosInstance
    .get(ACCOUNT_API_URL.viewCertification,queryParams)

}

export const PostJobCreate = (body) => {
    return axiosInstance
      .post(ACCOUNT_API_URL.postJob, body)
  }
  export const PostJobList = (queryParams) => {
    return axiosInstance
      .get(ACCOUNT_API_URL.listJob, {params: queryParams})
  }
  export const PostJobListFilter = (body) => {
    return axiosInstance.post(ACCOUNT_API_URL.listJobFilter,body)
  }
  export const CertificationListFilter = (body) => {
    return axiosInstance.post(ACCOUNT_API_URL.certificationFilter,body)
  }
  export const PostJobView = (queryParams) => {
    return axiosInstance
      .get(ACCOUNT_API_URL.viewJob,queryParams)

  }

  export const PostJobUpdate = (queryParams,body) => {
    return axiosInstance
      .post(ACCOUNT_API_URL.UpdateJob,body,{
        params:queryParams,  
      })

  }

  export const PostJobStatus = (body) => {
    return axiosInstance
      .put(ACCOUNT_API_URL.statusJob,body) 
  }


  export const CertificationStatus = (body) => {
    return axiosInstance
      .put(ACCOUNT_API_URL.statusCertificate,body) 
  }



  export const UserProfileUpdate = (body) => {
    return axiosInstance
      .post(ACCOUNT_API_URL.updateUserProfile,body) 
  }

  export const PostJobDelete = (params) => {
    return axiosInstance
      .put(ACCOUNT_API_URL.deleteJob,null, {params}) 
  }

  export const JobCategoryTypes = (params) => {
    return axiosInstance
      .post(ACCOUNT_API_URL.JobCategoryList,null, {params}) 
  }
  export const JobCertification = (params) => {
    return axiosInstance
      .post(ACCOUNT_API_URL.JobCertificationList,null, {params}) 
  }
  export const JobQualification = (params) => {
    return axiosInstance
      .post(ACCOUNT_API_URL.JobQualificationsList,null, {params}) 
  }

  export const JobSkillSet = (params) => {
    return axiosInstance
      .post(ACCOUNT_API_URL.JobSkillList,null, {params}) 
  }

  export const createNewSkill = (params) => {
    return axiosInstance
    .post(ACCOUNT_API_URL.CreateNewSkills,params) 
  }
  export const JobApplicationList = (body) => {
    return axiosInstance
      .post(ACCOUNT_API_URL.jobApplicationList,{body})
  }
  export const PaymentValidate = (body = {}) => {
    return axiosInstance
      .post(ACCOUNT_API_URL.jobPostPayementSubmit, body)
  }

  export const JobApplicationView = (id) => {
    return axiosInstance
      .get(ACCOUNT_API_URL.jobApplicationView,{params : {'id':id}})

  }


  export const CertificateAppliedView = (params) => {
    return axiosInstance
      .post(ACCOUNT_API_URL.certificateAppliedView,null, params)

  }



  export const JobApplicationDetails = (body) => {
    return axiosInstance
      .get(ACCOUNT_API_URL.jobApplicationView,body)

  }

  export const partTimerAcceptReject = (body) => {
    return axiosInstance
      .post(ACCOUNT_API_URL.jobApplicationAcceptRejectParttime,body)

  }



  // export const PostJobList = (queryParams) => {
  //   return axiosInstance
  //     .get(ACCOUNT_API_URL.listJob, {params: queryParams})
  // }
  export const JobApplyStatus = (data) => {
    return axiosInstance
      .post(ACCOUNT_API_URL.jobApplyStatus, data)
  }

  export const ApplicationPayment = (body) => {
    return axiosInstance.post(ACCOUNT_API_URL.applicationPayment, body)
  }
  export const ApplicationAccept = (data) => {
    return axiosInstance
      .post(ACCOUNT_API_URL.applicationAccept, data)
  }

  export const EmployerTag = (body) => {
    return axiosInstance
      .post(ACCOUNT_API_URL.employerTag, body)
  }

  export const EmployeeTag = (data) => {
    return axiosInstance
      .post(ACCOUNT_API_URL.employeeTag, data)
  }

  export const CertificationCourseList = (queryParams) => {
    return axiosInstance
      .get(ACCOUNT_API_URL.certificationCourseList, {params: queryParams})
  }

  export const CertificationCourseApplicationList = (body) => {
    return axiosInstance
      .post(ACCOUNT_API_URL.certificationCourseApplicationList,{body})
  }
